import React from "react";
import { Typography, Box, Button, Avatar, Input } from "@material-ui/core";
import TextField from "@material-ui/core/TextField";
import { Formik } from "formik";

const Index = () => {
  return (
    <div>
      <Box
        style={{
          marginTop: "10%",
          marginLeft: "450px",
          borderRadius: "5px",
          width: "400px",
          height: "350px",
          backgroundColor: "#F7F7F7",
        }}
      >
        <Box style={{ marginBottom: "10 px", textAlign: "center" }}>
          <Typography style={{ fontSize: "35px", textAlign: "center" }}>
            Log in
          </Typography>
        </Box>
        <Box style={{ marginLeft: "85px  " }}>
          <Typography>Email:</Typography>
          <Input
            style={{
              backgroundColor: "#ffffff",
              border: "1px solid #CCCCCC",
              borderBottom: "1px solid #CCCCCC",
              borderRadius: "4px",
              padding: "0px 10px",
            }}
            placeholder="Enter your Email"
          />
        </Box>
        <Box style={{ marginLeft: "85px ", marginTop: "15px" }}>
          <Typography>Password:</Typography>
          <Input
            style={{
              backgroundColor: "#ffffff",
              border: "1px solid #CCCCCC",
              borderBottom: "1px solid #CCCCCC",
              borderRadius: "4px",
              padding: "0px 10px",
            }}
            placeholder="Enter your Password "
          />
        </Box>
        <Box style={{ marginLeft: "85px" }}>
          <Button
            style={{
              marginTop: "50px",
              backgroundColor: "#347AB7",
              color: "white",
              width: "71%",
            }}
            variant="contained"
          >
            Log in
          </Button>
        </Box>
      </Box>
    </div>
  );
};
export default Index;
